CREATE DEFINER=`root`@`%` PROCEDURE `GetProducts` (IN `c_s_g_id` INT, IN `shop_id` INT, IN `startFrom` INT, IN `EndTo` INT)  begin
	IF c_s_g_id <= 0 THEN
		# -- Call When All Tab Call -- #
 		select 
		product.id as id,
		product.name as name,
		product.image as image,
		product.mrp_price as mrp_price,
		product.selling_price as selling_price,
        gender.name as gender,
		category.name as category,
		sub_category.name as sub_category,
        GROUP_CONCAT(color.name separator ',') as color
		from product
		left join category_sub_gender ON category_sub_gender.id = product.category_sub_gender_id
		left join gender ON gender.id = category_sub_gender.gender_id
		left join category ON category.id = category_sub_gender.category_id
		left join sub_category ON sub_category.id = category_sub_gender.sub_category_id
        left join product_color on product.id = product_color.product_id
		left join color on color.id = product_color.color_id
        where 
			product.shop_id = shop_id
        and
			product.deleted_at IS NULL
		group by 
			product.id 
		limit startFrom,EndTo;
    ELSE
		# -- Call When Specific Tab selected -- #
		select 
		product.id as id,
		product.name as name,
		product.image as image,
		product.mrp_price as mrp_price,
		product.selling_price as selling_price,
        GROUP_CONCAT(color.name separator ',') as color
		from product
        left join product_color on product.id = product_color.product_id
		left join color on color.id = product_color.color_id
		where 
			product.shop_id = shop_id 
        and
			product.category_sub_gender_id = c_s_g_id
		and
			product.deleted_at IS NULL
		group by 
			product.id 
        limit startFrom,EndTo;
    END IF;
	
end$$

