CREATE DEFINER=`root`@`%` PROCEDURE `TotalandPickedCount` (IN `order_id` INT, IN `picked_status_id` INT)  begin
	select 
		(
			select 
				count(ProductOrdered.id) 
			from 
				ProductOrdered 
			where 
				orders_id = order_id
		) 
	as total,
        (
			select 
				count(ProductOrdered.id) 
			from 
